def A383305(n):
    if n<=1: return n
    s={(k,k,k):1 for k in range(1,10)}
    for i in range(n-1):
        snew={}
        for (h,l,t),v in s.items():
            for d in range(10):
                p=(max(h,d),min(l,d),t+d)
                if p in snew:
                    snew[p]+=v
                else:
                    snew[p]=v
        s=snew
    return sum( v for (h,l,t),v in s.items() if n*(h-l)==t) # _Bert Dobbelaere_, Apr 25 2025

